package com.newgen.cbg.cache;

public class LpMasterDocDetails {
	
	String bpmDocName;
	String lpDocName;
	String lpDocId;
	public String getBpmDocName() {
		return bpmDocName;
	}
	public void setBpmDocName(String bpmDocName) {
		this.bpmDocName = bpmDocName;
	}
	public String getLpDocName() {
		return lpDocName;
	}
	public void setLpDocName(String lpDocName) {
		this.lpDocName = lpDocName;
	}
	public String getLpDocId() {
		return lpDocId;
	}
	public void setLpDocId(String lpDocId) {
		this.lpDocId = lpDocId;
	}

}
